  [],\n\t\"revision_timestamp\": \"2015-09-26T21:59:53.590384\",\n\t\"name\": \"geomagnetic-variation-data-1-minute-remote-geophysical-observatory-network-rgon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data file was generated as part of
  the International Magnetospheric Study (IMS). The file consists of values of the
  geomagnetic components D, H, X, Y, Z, and R averaged from 10-second instantaneous
  measurements. The 1-minute average values are computed at the Space Environment
  Center (SEC) in Boulder, Colorado, on the SELDADS computer system. The 10-second
  values are collected digitally in real time at the ground observatories and relayed
  to SEC via then                    SMS_GOES satellite and Wallops Island, Virginia,
  ground station. Twenty-six geomagnetic observatories provide data.\",\n\t\"license_title\":
